import React from 'react';

import Logo from '../assets/logo.svg'

const Header = () => {
  return <div className=' py-8'>
    <div className="container mx-auto">
      <div>
        <a href="#">
          <img src={Logo} alt="logo" />
        </a>
      </div>
    </div>
  </div>;
};

export default Header;
